@Override
public int hashCode() {
  final int prime = 31;
  int result = super.hashCode();
  result = prime * result
      + ((fromField == null) ? 0 : fromField.hashCode());
  result = prime * result
      + ((fromQuery == null) ? 0 : fromQuery.hashCode());
  result = prime * result
      + ((scoreMode == null) ? 0 : scoreMode.hashCode());
  result = prime * result + ((toField == null) ? 0 : toField.hashCode());
  return result;
}

